      * {
        margin: 0;
        padding: 0;
        position: fixed;

      }

      body {
        overflow: hidden;
        position: fixed;
        font-family: "work", Arial, sans-serif;
        -webkit-touch-callout: none;
      -webkit-user-select: none;
      -khtml-user-select: none;
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;
      font-size-adjust:none;
       font-size: 4.5vh;    
       white-space: nowrap;
    
      }

      #gameOver{
        visibility: hidden;
      }

      #restart{
        right: 1vw;
        bottom: 5vh;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);

      }
      #backToMenu{
        right: 1vw;
        bottom: 12vh;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);

      }

      #goText{
        
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        top: -1vh;

      }

      
      #menu{
        visibility: visible;
      }
      #score{
        left:5vw;
        top:7vh;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        position: relative;

        visibility: hidden;
      }
      #hs{
        left:5vw;
        top: 6vh;;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        position: relative;

      }
      #highScore{
        left:1%;
        bottom:1%;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        
        filter: drop-shadow(0 0 .5rem #3C3D9A);

      }

       #logo{
     
        width: 35%;
        height: auto;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        top: 1vh;
        left: 1vw;
      }
      #issaya{
        font-size:6vw;        
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        position: relative;
        left:37vw;
        top: -.7vw;
      }
      #title{
        left:1%;
        top:1%;
        
      }

      #levelSelect{
        left: 1%;
        top: 12%;
      }
     
      #level1{
        top:.1vh;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        position:relative;

      }
      #level2{
        top:.2vh;

        opacity: .3;
        background: linear-gradient(90deg, rgba(255,0,146,1) 0%, rgba(255,201,0,1) 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        filter: drop-shadow(0 0 .5rem #3C3D9A);
        position:relative;

      }
      #level3{
        top:.3vh;
